import { Component } from '@angular/core';
import { GifsService } from 'src/app/Gifs/Services/gift.service';

@Component({
  selector: 'shared-sidebar',
  templateUrl: './sidebar.component.html',
  styleUrls: ['./sidebar.component.css']
})
export class SidebarComponent {

  constructor(private _gifsService:GifsService) { }

  public getQueries(): string[] {
    return this._gifsService.queries;
  }
}
<h2 class="text-white text-center align-middle">Gifs</h2>
<hr class="text-light">
<ul class="list-group">
  <li class="list-group-item list-group-item-action mx-2 mr-2 ml-2"
      *ngFor="let query of getQueries()">
    {{query}}
  </li>
</ul>
